import React from 'react';
import '../CSS/NavBar.css';
import { Link } from '@reach/router'

const NavBar = () => {
  return (
    <nav className="navBar">
      <Link to="/">Home</Link>
      <Link to="/topics"> Topics</Link >
      <Link to="/articles"> Articles</Link >
      <Link to="/users"> Users</Link >
    </nav>
  );
};

export default NavBar;
